import React from 'react';
import {provider} from "react-redux";
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import store from "./store";

ReactDOM.render(
  <Provider store={store}>

    <App />

  </Provider>,document.getElementById('root'));
